window.bookSummaryJSON = "<p><i>You Are the Rock Star</i> is a self-empowerment guide that gives you the tools to live your dreams, discover your purpose, and feel damn good in the process.</p> <p>So if you know you're destined for greatness and you're ready to transform into the new, rock star image of yourself, it's time to take charge and embrace the power within-the power you've always had, the power to take charge of your life and your world.</p> <p>By the end of <i>You Are the Rock Star</i>, you will know what your dream is, how to go about getting it and how to navigate through the unwanted feelings of stress, anxiety, and self-doubt to become the most epic and legendary version of you!</p> <p><b>Written and Performed by Alexander Woodrow</b></p> <p><b>Foreword Written and Performed by Tara Stiles</b></p> <p><b>Introduction voiced by Dallis Seeker</b></p>"; 
